import React from 'react'
import Pollslist from './pollslist/Pollslist'
import Pollsdetails from './pollsdetails/Pollsdetails'
import '../../index.css'
const Content = ({polls, setPolls, handleSelectPoll}) => {
  
  return (
    <div className='d-flex mt-5'>
      {polls.length ? console.log("3amr"): console.log("walo")}
        <Pollslist 
          polls = {polls}
          setPolls = {setPolls}
        />
        <Pollsdetails 
          polls = {polls}
          setPolls = {setPolls}
          handleSelectPoll
        />
    </div>
  )
}

export default Content
